import React from "react";
import "react-dom";
import "bootstrap/dist/css/bootstrap.min.css";
import axios from "axios";

import swal from "sweetalert2";

var _currency,
  // _amount,
  _billing_name,
  _billing_address,
  _billing_city,
  _billing_state,
  _billing_postal_code,
  _billing_country;

class SingleLand extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  componentDidMount() {}

  handleCardCreate = (e) => {
    e.preventDefault();

    var formData = new FormData();
    formData.append("currency", _currency.value);
    formData.append("amount", "100");
    formData.append("billing_name", _billing_name.value);
    formData.append("billing_address", _billing_address.value);
    formData.append("billing_city", _billing_city.value);
    formData.append("billing_state", _billing_state.value);
    formData.append("billing_postal_code", _billing_postal_code.value);
    formData.append("billing_country", _billing_country.value);
    formData.append("callback_url", "hipheckts.github.io");

    console.log(formData);

    axios({
      method: "post",
      url: `https://api.flutterwave.com/v3/virtual-cards`,
      headers: {
        "content-type": "application/json",
        authorization: "Bearer FLWSECK_TEST-SANDBOXDEMOKEY-X"
      },
      data: formData
    })
      .then((status) => {
        console.log(status);
        return status;
      })
      .catch((error) => {
        console.log(error);
        // swal("Warning", "Error creating card", "warning");
      });
  };

  render() {
    return (
      <div className="container">
        <h1>ETF Virtual Card Test</h1>
        <form onSubmit={this.handleCardCreate} method="post">
          <div className="form-group">
            <label>Select Currency</label>
            <select
              ref={(input) => (_currency = input)}
              name="currency"
              className="form-control"
              id="currency-input"
              required
            >
              <option value="NGN">Nigerian Naira</option>
              <option value="USD">US Dollars</option>
            </select>
          </div>
          <div className="form-group">
            <label>
              Name <i>(Firstname Lastname)</i>
            </label>
            <input
              ref={(input) => (_billing_name = input)}
              name="billing_name"
              type="text"
              className="form-control"
              id="name-input"
              required
            />
          </div>
          <div className="form-group">
            <label>Address</label>
            <input
              ref={(input) => (_billing_address = input)}
              name="billing_address"
              type="text"
              className="form-control"
              id="address-input"
              required
            />
          </div>
          <div className="form-row">
            <div className="form-group col">
              <label>City</label>
              <input
                ref={(input) => (_billing_city = input)}
                name="billing_city"
                type="text"
                className="form-control"
                id="city-input"
                required
              />
            </div>
            <div className="form-group col">
              <label>State</label>
              <input
                ref={(input) => (_billing_state = input)}
                name="billing_state"
                type="text"
                className="form-control"
                id="state-input"
                required
              />
            </div>
          </div>
          <div className="form-row">
            <div className="form-group col">
              <label>Country</label>
              <input
                ref={(input) => (_billing_country = input)}
                name="billing_country"
                type="text"
                className="form-control"
                id="country-input"
                required
              />
            </div>
            <div className="form-group col">
              <label>Postal Code</label>
              <input
                ref={(input) => (_billing_postal_code = input)}
                name="billing_postal_code"
                type="text"
                className="form-control"
                id="postal_code-input"
                required
              />
            </div>
          </div>
          <button type="submit" className="btn btn-primary float-right">
            Create Card
          </button>
        </form>
      </div>
    );
  }
}

export default SingleLand;
